import Topbar from "./components/topbar/Topbar";
import About from "./components/about/About";
import Projects from "./components/projects/Projects";
import Contact from "./components/contact/Topbar";
function App() {
  return (
    <div className="app">
      <Topbar/>
      <div className="sections">
        <About/>
        <Projects/>
        <Contact/>
      </div>
    </div>
  );
}

export default App;
